var title_f6_63_7152="Amanita phalloides-Death cap";
var content_f6_63_7152=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F73705&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F73705&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Amanita phalloides (\"Death cap\")",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    One of the most toxic mushrooms, this cyclopeptide-containing mushroom is responsible for the majority of human fatalities due to mushroom poisoning because of the life-threatening liver toxicity that it can cause. Note the greenish white cap and large bulbous root. This specimen was mistaken for the edible mushrooms, Caesar's mushroom (",
"    <em>",
"     Amanita caesara",
"    </em>",
"    ) and straw mushroom (",
"    <em>",
"     Volvariella volvacea",
"    </em>",
"    ) and was picked in the Finger Lakes Region of New York State.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of William Hollenbaugh.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
