var title_f6_63_7164="Decision tree";
var content_f6_63_7164=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F70214&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F70214&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Decision tree - Save tissue for the following potential special studies. Consultation with a clinical geneticist can be helpful in all of these cases.",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Skeletal dysplasia/Craniosynostosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Freeze long bone (at 4 degrees Celsius)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Obtain tissue for DNA studies (skeletal muscle, skin)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Karyotype",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Renal anomalies",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Karyotype",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Urinalysis for protein and crystals",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Freeze skin or renal tissue (at 4 degrees Celsius) for possible future genetic testing",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Inborn error of metabolism",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Freeze bile (at 4 degrees Celsius)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Save tissue for biochemical analysis (skin, brain, skeletal muscle, liver), consult with laboratory specialists as to how to obtain and preserve",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Hydrops fetalis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Blood smear (if not autolyzed) for morphologic evaluation of cells (eg, congenital dyserythropoetic anemia)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Hematocrit",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Karyotype",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Viral cultures if suggested by clinical findings",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Blood typing",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Arthrogryposes (any type)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Karyotype",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Neuropathology consultation for muscle biopsy, spinal cord",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Freeze skin or skeletal muscle (at 4 degrees Celsius) for possible future genetic testing",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Dysmorphic features",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Karyotype",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
