var title_f6_63_7166="AHT drug and outcome ALLHAT";
var content_f6_63_7166=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F82432&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F82432&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 473px\">",
"   <div class=\"ttl\">",
"    Choice of antihypertensive monotherapy does not predict outcome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 453px; height: 269px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the ALLHAT trial, cumulative event rates for the primary outcome (fatal coronary heart disease or nonfatal myocardial infarction) according to primary treatment with chlorthalidone, amlodipine, or lisinopril. Compared to chlorthalidone, there was no significant difference with amiodipine (relative risk 0.98) or lisinopril (relative risk 0.99 percent) at a mean of 4.9 years.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from The ALLHAT Officers, JAMA 2002; 288:2981.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
